import * as C from './style'

type Props = {
  title: string;
  description: string;
  icon: string;
}

export const SelectOption = ({}) => {
  return (
    <C.Container>
      <C.icon>{icon}</C.icon>
      <C.Info>
        <C.Title>{title}</C.Title>
      </C.Info>
    </C.Container>
  )
}
